import React, {useState} from "react";
import "./style.css";
import axios from "axios";

function Login() {
    const [user, getUser] = useState({username: "", password: ""});


    function handleSignin(e) { 
        e.preventDefault();
            axios.get("/api/users/signup", user).then((res)=>{
                console.log(res)
            }).catch((err)=>{
                console.error(err)
            });

        }

   return (<div>
        <h2>Log In</h2>
        <form>
            <input type="text" value={user.username} placeholder="Username"></input>
            <input type="password" value={user.password} placeholder="Password"></input>
            <button onClick={handleSignin}>Login</button>
        </form>
    </div>)
};

export default Login;
